import React, { useState, useEffect } from 'react';
import { GoogleMap, LoadScript, Marker, InfoWindow } from '@react-google-maps/api';
import './Home.css';

function Home() {
  const [stations, setStations] = useState([]);
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredStations, setFilteredStations] = useState([]);
  const [suggestions, setSuggestions] = useState([]);
  const [showMap, setShowMap] = useState(false);
  const [selectedStation, setSelectedStation] = useState(null);

  useEffect(() => {
    // Fetch stations dynamically (this simulates fetching the stations)
    const fetchStations = async () => {
      const stationsFromMap = [
        {
          id: 1,
          name: 'Afcon EV',
          address: 'Industrial Area, Dimona',
          city: 'Dimona',
          status: 'Available',
          waitTime: 0,
          location: { lat: 31.0708, lng: 35.0331 },
        },
        {
          id: 2,
          name: 'Paz (Yellow)',
          address: 'Milos Hotel, Ein Bokek',
          city: 'Dead Sea',
          status: 'Occupied',
          waitTime: 2,
          location: { lat: 31.2001, lng: 35.3643 },
        },
        {
          id: 3,
          name: 'EV Edge',
          address: 'Sonol Gas Station, Yeruham',
          city: 'Yeruham',
          status: 'Available',
          waitTime: 1,
          location: { lat: 30.9876, lng: 34.9312 },
        },
      ];
      setStations(stationsFromMap);
      setFilteredStations(stationsFromMap);
    };

    fetchStations();
  }, []);

  const handleSearch = (query) => {
    setSearchQuery(query);

    const matches = stations
      .map((station) => station.city)
      .filter((city, index, array) => array.indexOf(city) === index)
      .filter((city) => city.toLowerCase().includes(query.toLowerCase()));

    setSuggestions(matches);

    const filtered = stations.filter(
      (station) =>
        station.city.toLowerCase().includes(query.toLowerCase()) ||
        station.address.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredStations(filtered);
  };

  const handleSuggestionClick = (suggestion) => {
    setSearchQuery(suggestion);
    setSuggestions([]);
    const filtered = stations.filter(
      (station) =>
        station.city.toLowerCase() === suggestion.toLowerCase() ||
        station.address.toLowerCase().includes(suggestion.toLowerCase())
    );
    setFilteredStations(filtered);
  };

  const mapContainerStyle = {
    width: '100%',
    height: '400px',
    borderRadius: '15px',
  };

  const mapCenter =
    filteredStations.length > 0
      ? filteredStations[0].location
      : { lat: 32.0853, lng: 34.7818 };

  return (
    <div className="home-container">
      <header className="header">
        <h1 className="title">AC/DC Charging Stations</h1>
      </header>

      <div className="search-bar-container">
        <input
          type="text"
          placeholder="Search for a city or address..."
          value={searchQuery}
          onChange={(e) => handleSearch(e.target.value)}
          className="search-bar"
        />
        <button className="map-button" onClick={() => setShowMap(!showMap)}>
          {showMap ? 'Back to List' : 'Show Map'}
        </button>
        {suggestions.length > 0 && (
          <ul className="suggestions-list">
            {suggestions.map((suggestion, index) => (
              <li
                key={index}
                onClick={() => handleSuggestionClick(suggestion)}
                className="suggestion-item"
              >
                {suggestion}
              </li>
            ))}
          </ul>
        )}
      </div>

      {showMap ? (
        <div className="map-container">
          <iframe
            src="https://www.google.com/maps/d/embed?mid=1smMeGPnJ-oxr_8kuiwfB9i6iCURwl8bp&ehbc=2E312F"
            width="100%"
            height="480"
            style={{ border: 0 }}
            allowFullScreen
            loading="lazy"
            title="Charging Stations Map"
          ></iframe>
        </div>
      ) : (
        <LoadScript googleMapsApiKey="AIzaSyDaXpZE3bFz-0An8LY3vi7vMrkVtLypi7A">
          <GoogleMap mapContainerStyle={mapContainerStyle} center={mapCenter} zoom={10}>
            {filteredStations.map((station) => (
              <Marker
                key={station.id}
                position={station.location}
                onClick={() => setSelectedStation(station)}
              />
            ))}
            {selectedStation && (
              <InfoWindow
                position={selectedStation.location}
                onCloseClick={() => setSelectedStation(null)}
              >
                <div>
                  <h3>{selectedStation.name}</h3>
                  <p>
                    <strong>Address:</strong> {selectedStation.address}
                  </p>
                  <p>
                    <strong>Status:</strong>{' '}
                    {selectedStation.status === 'Available' ? 'Available' : 'Occupied'}
                  </p>
                  <p>
                    <strong>Wait Time:</strong> {selectedStation.waitTime} people waiting
                  </p>
                </div>
              </InfoWindow>
            )}
          </GoogleMap>
        </LoadScript>
      )}
    </div>
  );
}

export default Home;
